	declare nbulan int(2);
    declare tahun varchar(4);
    declare bulan varchar(10);
    declare tgl varchar(2);
    
    set tahun  = splitstr(tanggal, '-', 1);
    set nbulan = splitstr(tanggal, '-', 2);
    set bulan  = splitstr(namabulan, '|', (nbulan));
